class PatternCompute:

    def numTimes(text, pattern):
        i = 0
        count = 0
        while i <= len(text) - len(pattern):
            if text[i : i + len(pattern) ] == pattern:
                count += 1
            i += 1
        return count

    def mostFrequent(text, kmer):
        i = 0
        wordDic = {}
        while i <= len(text) - kmer:
            if text[i : i + kmer] not in wordDic:
                wordDic[text[i: i + kmer]] = 1
            else:
                wordDic[text[i: i + kmer]] = wordDic[text[i: i + kmer]] + 1
            i += 1

        mostCommonNumber = max(wordDic.values())
        mostCommonWords = []
        for words in wordDic:
            if wordDic[words] == mostCommonNumber:
                # print words
                mostCommonWords.append(words)

    def reverseComplement(self, text):
        i = 0
        string = ""
        while i < len(text):
            curLetter = text[len(text) - i - 1]
            if curLetter == 'A':
                newLetter = "T"
            elif curLetter == 'T':
                newLetter = "A"
            elif curLetter == 'C':
                newLetter = "G"
            else:
                newLetter = "C"
            string += newLetter
            i += 1
        return string

