    def symbolToNumber(self, symbol):
        if symbol == "A":
            return 0
        if symbol == "C":
            return 1
        if symbol == "G":
            return 2
        if symbol == "T":
            return 3

    def numberToSymbol(self, number):
        if number == 0:
            return "A"
        if number == 1:
            return "C"
        if number == 2:
            return "G"
        if number == 3:
            return "T"

    def patternToNumber(self, pattern):
        if len(pattern) == 0:
            return 0
        symbol = pattern[len(pattern) - 1]
        prefix = pattern[0:len(pattern) - 1]

        return 4 * self.patternToNumber(prefix) + self.symbolToNumber(symbol)

    def numberToPattern(self, index, kmer):
        if kmer == 1:
            return self.numberToSymbol(index)
        prefixindex = index / 4
        remainder = index % 4
        symbol = self.numberToSymbol(remainder)
        prefixPattern = self.numberToPattern(prefixindex, kmer - 1)
        newpat = prefixPattern + symbol
        return newpat

    def neighbors(self, pattern, mismatch):
        nucleotides = ["A", "C", "G", "T"]
        if mismatch == 0:
            return pattern
        if len(pattern) == 1:
            return {"A", "C", "G", "T"}
        neighborhood = set()
        suffixNeighbors = self.neighbors(pattern[1: len(pattern)], mismatch)
        for text in suffixNeighbors:
            if self.hammingDistance(pattern[1: len(pattern)], text) < mismatch:
                for x in nucleotides:
                    newpat = x + text
                    neighborhood.add(newpat)
            else:
                newpattern = pattern[0] + text
                neighborhood.add(newpattern)
        return neighborhood

    def generateFrequencyArray(self, text, kmer):
        i = 0
        freqArray = []
        u = 0
        while u < 4**kmer:
            freqArray.append(0)
            u += 1

        while i < len(text) - kmer + 1:
            num = self.patternToNumber(text[i:i+kmer])
            freqArray[num] = freqArray[num] + 1
            i += 1
        return freqArray


